import React from "react";
import { Route, Routes } from "react-router-dom";
import { Landing, NotFound } from "../index.js";
import SneakersRouter from "./sneakers.jsx";
import AuthRouter from "./auth.jsx";

export const Router = () => {
  return (
    <Routes>
      <Route path="/" element={<Landing />} />
      <SneakersRouter />
      <AuthRouter />
      <Route path="*" element={<NotFound />} />
    </Routes>
  );
};
